import FaqCss from "./faq.module.css";
import React from "react";

function Faqs() {
  return (
    <>
      <div className={FaqCss.container3}>
        <p className={FaqCss.faq}>Frequently Asked Questions</p>
        <div className= {FaqCss.main_box}>
            <div></div>
            <div></div>
            <div></div>
        </div>
      </div>
    </>
  );
}

export default Faqs;
